import Post from './post/post'
import postsCss from './posts.module.css'

let postData = [
    {url: 'http://t1.gstatic.com/licensed-image?q=tbn:ANd9GcS1xiT6qVFhxkibqkniltoCX2igbcSxDhosS_GHdrmCcvA2UnX-3n71K_L-uLGQfBAT', username: 'Джонатан' },
    {url: 'https://oir.mobi/uploads/posts/2020-04/thumbs/1586448949_13-p-ember-kherd-18.jpg', username: 'Эмбер Херд' }
]

let postsElem = postData.map(post => <Post urlAvatar ={post.url} username= {post.username} />)

let Posts = (props) => {
    return (
        <div className={postsCss.comment}>
            <h2>Оставить комментарий</h2>
            <textarea maxLength={100} placeholder={'Оставьте комментарий'}></textarea>
            <button>Отправить</button>
            {postsElem}
        </div>
    )
}
export default Posts
